pub enum UrlGenerationError {
    ResourceNotFound,
    NotEnoughElements,
    ParseError(UrlParseError),
}

pub enum UrlencodedError {
    Chunked,
    Overflow {
        size: usize,
        limit: usize,
    },
    UnknownLength,
    ContentType,
    Parse,
    Payload(PayloadError),
}

pub enum JsonPayloadError {
    Overflow,
    ContentType,
    Deserialize(JsonError),
    Payload(PayloadError),
}

pub enum ReadlinesError {
    EncodingError,
    Payload(PayloadError),
    LimitOverflow,
    ContentTypeError(ContentTypeError),
}

pub enum EitherResponder<A, B> where A: Responder, B: Responder {
    A(A::Future),
    B(B::Future),
}
